import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './VendorLogin.css';

const VendorLogin = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [showPassword, setShowPassword] = useState(false);

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch('http://localhost:5000/api/vendors/login', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ email, password }),
      });

      const result = await response.json();
      if (response.ok) {
        // Store token and vendor info in localStorage
        localStorage.setItem('vendorToken', result.token);
        localStorage.setItem('vendorInfo', JSON.stringify(result.vendor));
        // Redirect to dashboard
        window.location.href = '/vendor/dashboard';
      } else {
        alert('Login failed: ' + result.error);
      }
    } catch (error) {
      console.error('Error during login:', error);
      alert('Login failed: Unable to connect to server');
    }
  };

  return (
    <div className="vendor-login-container">
      <nav className="navbar">
        <div className="logo">MarketConnect</div>
        <ul>
          <li><Link to="/">Home</Link></li>
          <li>About</li>
          <li>Contact</li>
        </ul>
      </nav>

      <div className="breadcrumb">Home &gt; Vendor &gt; Login</div>

      <div className="login-box">
        <h1>Vendor Login</h1>
        <p className="subtitle">
          Access your vendor dashboard to manage products and track sales
        </p>

        <form className="login-form" onSubmit={handleSubmit}>
          <label>Email Address</label>
          <div className="input-group">
            <input
              type="email"
              placeholder="Enter your email address"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
            />
            <span className="icon">@</span>
          </div>

          <label>Password</label>
          <div className="input-group">
            <input
              type={showPassword ? 'text' : 'password'}
              placeholder="Enter your password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
            />
            <span
              className="icon"
              onClick={() => setShowPassword(!showPassword)}
              style={{ cursor: 'pointer' }}
            >
              {showPassword ? 'üôà' : 'üëÅÔ∏è'}
            </span>
          </div>

          <div className="forgot">
            <a href="#">Forgot password?</a>
          </div>

          <button className="login-btn" type="submit">Login</button>
        </form>

        <div className="or">Or continue with</div>

        <div className="social-buttons">
          <button className="google-btn">Google</button>
          <button className="facebook-btn">Facebook</button>
        </div>

        <div className="register-links">
          <p>Don't have an account?</p>
          <Link to="/vendor/register"><button className="outline-btn">Register as Vendor</button></Link>
          <Link to="/vendor"><button className="outline-btn">Back</button></Link>
        </div>
      </div>
    </div>
  );
};

export default VendorLogin;
